	["so_purple"] = { name = "Ultrafiolet", desc = "Poszczególne części tej broni zostały pomalowane farbą w sprayu na kolor czarny i fioletowy.\n\nEleganckie wzornictwo w połączeniu z barbarzyńskim przeznaczeniem." },
