	["so_sand"] = { name = "Wydma piaskowa", desc = "Poszczególne części tej broni zostały pomalowane farbą w sprayu w kolorach imitujących wydmy piaskowe.\n\nTeraz, gdy Turner jest martwy, mamy nowy priorytet: ocalić Alexa Kincaide'a. – Felix Riley, oficer dowodzący" },
	["so_stormfront"] = { name = "Burza", desc = "Poszczególne części tej broni zostały pomalowane farbą w sprayu w kolorach imitujących burzę.\n\nBędzie na ciebie czekać przy kolejce." },
	["so_tornado"] = { name = "Tornado", desc = "Poszczególne części tej broni zostały pomalowane farbą w sprayu w kolorach imitujących tornado.\n\nNie daj się zwieść jej prostocie." },
	["so_whiteout"] = { name = "Wybielenie", desc = "Broń została pomalowana farbą w sprayu na biało.\n\nWygląda szlachetnie, ale pierwsze wrażenie bywa zwodnicze." },
