	["so_pmc"] = { name = "Kontrahent", desc = "Poszczególne części tej broni zostały pomalowane farbą w sprayu na kolor piaskowy, granatowy i ciemnozielony.\n\nRona Sabri wciąż nie wybaczyła Sebastienowi tego, że nie wybrał jej do dorwania Turnera." },
	["so_tangerine"] = { name = "Demolka", desc = "Poszczególne części tej broni zostały pomalowane farbą w sprayu na kolor czarny i mandarynkowy.\n\nRona jest tak dobra, za jaką się uważa... ale nie jest na tyle dorosła, by zdała sobie sprawę, że nie powinna się tym chwalić. – Felix Riley, oficer dowodzący" },
