	["an_silver"] = { name = "Srebro", desc = "Broń została pomalowana warstwą chromowego podkładu, a następnie przejrzystą farbą naśladującą efekt anodyzowania w kolorze srebrnym, którą utwardzono.\n\nPiękno tkwi w prostocie. – Franz Kriegeld, taktyk Phoenix" },
	["an_red"] = { name = "Hot rod", desc = "Broń została pomalowana warstwą chromowego podkładu, a następnie przejrzystą farbą naśladującą efekt anodyzowania w kolorze czerwonym, którą utwardzono.\n\nAutomatyczny. Systematyczny. Hydromatyczny." },
	["an_gunmetal"] = { name = "Anodyzowany niebieskoszary", desc = "an_gunmetal" },
	["an_navy"] = { name = "Anodyzowany granatowy", desc = "Broń została pomalowana warstwą chromowego podkładu, a następnie przejrzystą farbą naśladującą efekt anodyzowania w kolorze granatowym, którą utwardzono." },
	["am_urban"] = { name = "Metaliczny DDPAT", desc = "Broń została pomalowana warstwą metalicznego podkładu, a następnie pokryta hydrografiką w postaci kamuflażu cyfrowego (DDPAT)." },
	["am_tiger"] = { name = "Złoty tygrys", desc = "Broń została okuta złotem i ręcznie wygrawerowano na niej wzór tygrysich pasów." },
	["am_dragon_glock"] = { name = "Smoczy tatuaż", desc = "Broń została pomalowana warstwą metalicznego podkładu, a następnie pokryta naklejką w postaci smoka.\n\nW bajkach rycerz zawsze pokonuje smoka... ale życie to nie bajka. – Valeria Jenner, rewolucjonistka" },
	["am_caustics"] = { name = "Kaustyk", desc = "Broń została pomalowana warstwą metalicznego podkładu w kolorze węgla drzewnego, a następnie pokryta hydrografiką w kolorze czerwonym i białym." },
	["am_lightning_awp"] = { name = "Uderzenie pioruna", desc = "Broń została pomalowana warstwą metalicznego podkładu, a następnie przejrzystą farbą naśladującą efekt anodowania naniesiono motyw piorunu, którą utwardzono.\n\nCzasem nie musisz trafiać dwa razy w to samo miejsce." },
	["am_ossify"] = { name = "Skostniały", desc = "Broń została pomalowana warstwą metalicznego podkładu, a następnie pokryta abstrakcyjną, przejrzystą limonkową hydrografiką." },
	["aa_flames"] = { name = "Żar", desc = "Broń została pomalowana warstwą chromowego podkładu, a następnie nałożono na nią aerografem przejrzyste farby w jaskrawych kolorach." },
	["aa_splash_p250"] = { name = "Rozprysk", desc = "Broń została pomalowana warstwą chromowego podkładu, a następnie nałożono na nią aerografem przejrzyste farby przy pomocy szablonu." },
	["aa_fade"] = { name = "Gradient", desc = "Broń została pomalowana warstwą chromowego podkładu, a następnie nałożono na nią aerografem dwie farby tworzące płynne przejście tonalne.\n\nTo nie jest zwykła broń, to niewyczerpany temat do rozmów. – Imogen, początkująca handlarka bronią" },
