	["aa_fade_grassland"] = { name = "Smuga kwasu", desc = "aa_fade_grassland" },
	["aq_copper"] = { name = "Miedź", desc = "Broń została okuta miedzią." },
	["aq_blued"] = { name = "Niebieska stal", desc = "Broń została poddana oksydacji.\n\nTo malbec produkcji broni - Booth, handlarz bronią" },
	["aq_forced"] = { name = "Śniedź", desc = "Broń została pokryta nienaturalną śniedzią powstałą w wyniku polewania musztardą i sokiem z cytryny.\n\nJeśli teraz wydaje ci się upaćkana, poczekaj, aż zobaczysz ją w ultrafiolecie." },
	["aq_oiled"] = { name = "Stal nawęglana", desc = "Metalowe elementy tej broni zawdzięczają swój kolor utwardzaniu w wysokiej temperaturze z użyciem węgla drzewnego.\n\nOd odrobiny koloru nikt jeszcze nie umarł." },
	["sp_spitfire_famas"] = { name = "Spitfire", desc = "sp_spitfire_famas" },
	["am_zebra"] = { name = "Rzeź", desc = "Broń została pomalowana w zebrę aluminiowymi i chromowymi farbami o różnej przepuszczalności światła, a następnie pokryta warstwą cukierkowej farby w kolorze pomidorowym.\n\nValeria nie płaci Javierowi za zadawanie pytań... płaci mu za uzyskiwanie odpowiedzi." },
	["am_zebra_dark"] = { name = "Mroczne wody", desc = "Broń została pomalowana warstwą chromowego podkładu, a następnie metalicznymi, grafitowymi farbami o różnej przepuszczalności światła namalowano wzór naśladujący załamujące się w wodzie światło.\n\nWoda daje życie, lecz może je również odebrać..." },
	["aa_vertigo"] = { name = "Hipnoza", desc = "Broń została pomalowana warstwą perłowego podkładu, a następnie czarną farbą w sprayu przy użyciu szablonu ze wzorem.\n\nNie robisz się senny, tylko tracisz przytomność z powodu utraty krwi." },
	["cu_spring_nova"] = { name = "Rozkwit", desc = "Broń została ozdobiona kwiatami wiśni, które naniesiono aerografem, a następnie pomalowano warstwą farby o wysokim połysku." },
	["sp_hazard"] = { name = "Niebezpieczeństwo", desc = "sp_hazard" },
	["aq_rust"] = { name = "Rdza", desc = "Pomimo tego, że zewnętrzna powłoka jest zardzewiała, to ta broń jest nadal zdatna do użytku." },
	["am_slither_p90"] = { name = "Zimnokrwisty", desc = "Broń została pokryta warstwą chromowego podkładu, a następnie przejrzystą farbą naśladującą efekt anodyzowania w kolorze czerwonym, którą utwardzono. Na koniec broń zyskała laserowo wygrawerowany motyw wijącego się węża." },
	["am_carbon_fiber"] = { name = "Włókno węglowe", desc = "Broń została pomalowana warstwą grafitowego podkładu, a następnie pokryta hydrografiką w postaci włókna węglowego.\n\nTo, że poniosłam drużynę na własnych barkach, nie oznacza, że nie był to drużynowy wysiłek. – Rona Sabri, wschodząca gwiazda" },
	["am_scorpion_p2000"] = { name = "Skorpion", desc = "Broń została pomalowana farbą naśladującą efekt anodyzowania w falowany gradient, a następnie jej chwyt został pokryty naklejką w postaci czerwonego skorpiona." },
	["hy_feathers_aug"] = { name = "Skrzydła", desc = "Broń została pokryta naklejkami w postaci orlich piór.\n\nOrzeł wygląda majestatycznie, dopóki nie próbuje wydrapać ci oczu." },
