	["aq_brass"] = { name = "Mosiądz", desc = "Niektóre elementy tej broni zostały zastąpione mosiądzem.\n\nZłoto głupców." },
	["hy_blam"] = { name = "KABUM!", desc = "Broń została pomalowana warstwą pomarańczowego podkładu, a następnie pokryta hydrografiką w postaci komiksowej onomatopei." },
