	["sp_dapple"] = { name = "Popiół", desc = "Broń została pomalowana farbą w sprayu we wzór naśladujący plamy światła.\n\nFeniks nie symbolizuje zniszczenia... symbolizuje odrodzenie. – Valeria Jenner, rewolucjonistka" },
