	["am_metals"] = { name = "Rycerz", desc = "Broń posiada mosiężne akcenty z motywem renesansowej zbroi.\n\nCo to znaczy, że nie możesz znaleźć Cocinero i Izakiego? – Felix Riley, oficer dowodzący" },
	["am_chainmail"] = { name = "Kolczuga", desc = "Broń została pomalowana warstwą srebrnego podkładu, a następnie pokryta półprzezroczystą hydrografiką w postaci kolczugi.\n\nZe wszystkich członków Phoenix żaden nie był tak lojalny Valerii jak jej ochroniarz, Naomi." },
	["aq_handcannon"] = { name = "Działo ręczne", desc = "Broń posiada mosiężne elementy polane kwasem, przez co sprawia wrażenie antycznego mosiądzu armatniego.\n\nPrzygotuj się na wiele cierni podczas swoich prób." },
	["am_metal_inlay"] = { name = "Wiek ciemny", desc = "Broń została pomalowana metalicznymi farbami, przez co wygląda jak inkrustowana metalem w średniowiecznych motywach.\n\nMógłbym zabić jej kochanka... może to kupiłoby ci nieco czasu z Valerią. – Ojcowska miłość, część II" },
	["hy_vines"] = { name = "Dzika róża", desc = "Broń została pokryta hydrografiką w postaci wijących się winorośli i kwiatów.\n\nPocałunek prawdziwej miłości nie uchroni cię przed jej docinkami." },
	["so_indigo"] = { name = "Królewski błękit", desc = "Broń została pomalowana farbami w kolorze indygo, bordo i szarym.\n\nFelix, powinieneś się uśmiechnąć. Miałbyś więcej szczęścia z kobietami, gdybyś nie był przez cały czas takim ponurym draniem. – Imogen, początkująca handlarka bronią" },
	["so_indigo_and_grey"] = { name = "Indygo", desc = "Broń została pomalowana farbami w kolorze indygo, niebieskim i szarym.\n\nPanie Alex Kincaide, nie wątpię, że ma pan wiele pytań... pozwoli pan, że udzielę na nich odpowiedzi. – Phoenix i gawędziarz, część I" },
	["cu_well_traveled_ak47"] = { name = "Turysta", desc = "Kolba została oprawiona brązową skórą. Ta broń zwiedziła wiele miejsc.\n\nKażda osoba, która słuchała uważnie, połączy fakty i zobaczy, co zrobiliśmy. Nie mamy zbyt wiele czasu na znalezienie rozwiązania... – Ojcowska miłość, część I" },
	["cu_green_leather"] = { name = "Pierwsza klasa", desc = "Kolba broni została oprawiona w zieloną skórę.\n\nNie zawiera mimozy." },
	["cu_brown_leather_p90"] = { name = "Skóra", desc = "Kolba broni została oprawiona w brązową skórę.\n\nNie bój się, można z nią bezpiecznie latać." },
	["cu_luggage_mac10"] = { name = "Dojeżdżający", desc = "Broń została pokryta hydrografiką w postaci kraty i częściowo oprawiona imitacją skóry krokodyla.\n\nPołknęli haczyk, ruszajmy... – Elliott Kingsman, najemnik" },
	["cu_medieval_dragon_awp"] = { name = "Smocza wiedza", desc = "Broń została ozdobiona na zamówienie grafiką plecionego smoka.\n\nNawet 200 kluczy nigdy nie odblokowałoby jego tajemnic." },
	["cu_luggage_p2000"] = { name = "Klasa ekonomiczna", desc = "Broń została pokryta hydrografiką w postaci kraty, a jej uchwyt został częściowo oprawiony w brązową skórę.\n\nNie wygląda najlepiej, ale zabierze cię tam, gdzie potrzebujesz." },
	["aq_pilot_deagle"] = { name = "Pilot", desc = "Broń posiada mosiężne elementy skrzydeł pilota.\n\nPrzyjmij pozycję do awaryjnego lądowania." },
	["cu_leather_xm1014"] = { name = "Czerwona skóra", desc = "Kolba i uchwyt tej broni zostały oprawione w czerwoną skórę.\n\nPakuj manatki. Idziemy zabić tego sukinkota... - Oni i walkiria, część II" },
	["cu_luggage_sg553"] = { name = "Podróżnik", desc = "Broń została ozdobiona na zamówienie wzorem w paski inspirowanym starymi torbami bagażowymi, a niektóre części zostały oprawione w brązową skórę.\n\nKażdy ma jakąś historię, a Javier wydrze ją przed twoją śmiercią." },
	["cu_luggage_usp-s"] = { name = "Biznes klasa", desc = "Broń została ozdobiona na zamówienie wyjątkowym zestawieniem kolorów i wzorów inspirowanych starymi torbami bagażowymi, a niektóre części zostały oprawione w brązową skórę.\n\nNiektórym ludziom nie wystarcza więcej miejsca na nogi... oni chcą ciszy i spokoju." },
	["hy_plaid1"] = { name = "Oliwkowa krata", desc = "Broń została pokryta hydrografiką w postaci kraty w kolorze beżowym i oliwkowym.\n\nPodoba mi się. Uwydatnia moje oczy na zdjęciach... – Rona Sabri, wschodząca gwiazda" },
