	["cu_tribute_ak47"] = { name = "Pustynny buntownik", desc = "Broń została sztucznie postarzona, pokryta stemplowanymi wzorami oraz graffiti.\n\nPewnego dnia zapytają, dlaczego walczymy i wtedy zrozumieją. – Naomi, ochroniarz Valerii Jenner" },
	["aq_glock_coiled"] = { name = "Młynek", desc = "Stalowy zamek został ręcznie pomalowany farbą olejną przy użyciu szablonu.\n\nJedyny sposób na stworzenie diamentów to wywieranie nacisku." },
	["am_g3sg1_murky"] = { name = "Mętny", desc = "Broń została anodyzowana, a następnie pokryta hydrografiką w postaci lamparcich cętek.\n\nZawsze możesz znaleźć jeszcze ciemniejsze miejsce." },
	["aq_m4a1s_basilisk"] = { name = "Bazyliszek", desc = "Broń została wygrawerowana wzorem w postaci bazyliszka.\n\nGapienie się jest nieuprzejme, ale wojna to nie czas na uprzejmość." },
	["cu_m4a4_griffin"] = { name = "Gryf", desc = "Broń została pokryta ręcznie malowanym wzorem w postaci gryfa.\n\nFelix samodzielnie zebrał agentów z całego świata do swojego zespołu... często krytykuje się ich cechy charakteru, ale nigdy osiągane przez nich rezultaty." },
	["sp_mag7_firebitten"] = { name = "Podpalacz", desc = "Broń została pomalowana farbą w sprayu warstwami, które następnie sztucznie postarzono, aby nadać im wygląd żaru.\n\nWszystko zawsze zaczyna się od jednej iskierki." },
	["cu_mp9_chevron"] = { name = "Rzutka", desc = "Broń została pokryta hydrografiką w postaci szeregu szewronów.\n\nPrzy wystarczająco wielu powtórzeniach w końcu trafi się w dziesiątkę." },
	["aq_p250_cartel"] = { name = "Kartel", desc = "Broń została wygrawerowana rysunkami szkieletów, kwiatów i węży.\n\nWystarczy pociągnąć za spust i każdy poranek zmienia się w meksykański Dzień Zmarłych." },
	["cu_p2000_fire_elemental"] = { name = "Żywiołak ognia", desc = "Broń została ozdobiona na zamówienie grafiką ognistego potwora.\n\nCzasem zabawy z ogniem wychodzą na dobre." },
	["aq_sawedoff_blackgold"] = { name = "Rozbójnik", desc = "Broń została polakierowana na czarno i żółto z wykorzystaniem motywu popłochu pospolitego.\n\nNie musisz unosić małego palca ciągnąc za spust, choć tak nakazywałaby etykieta." },
	["cu_scar20_intervention"] = { name = "Zawałowiec", desc = "Broń została pokryta termokurczliwym winylem w nowoczesnym pomarańczowo-niebieskim wzorze.\n\nBip. Bip. Biiiiiiiip..." },
	["sp_ump45_d-visions"] = { name = "Złudzenie", desc = "Broń została pomalowana metodą sitodruku w motywie morskiego stworzenia.\n\nCarcosa wzywa." },
	["cu_xm1014_caritas"] = { name = "Opanowanie", desc = "Broń została pokryta ręcznie malowanym wzorem w postaci kobiety z długimi włosami.\n\nNie potrzebuję tego, po co tu przyszłam; ja tego chcę. – Imogen i Oni, część II" },
	["am_awp_glory"] = { name = "Okręt wojenny", desc = "Broń została pokryta warstwą niebieskiego, metalicznego podkładu, a następnie ręcznie pomalowana metalicznymi złotymi wirami i zakrętami. \n\nNiech stracą głowy w przenośni, zanim zrobią to dosłownie." },
	["cu_elites_urbanstorm"] = { name = "Miejski wstrząs", desc = "Broń została ozdobiona na zamówienie miejskim kamuflażem z niebieskimi motywami.\n\nWraz z błyskawicą zawsze nadchodzi burza." },
	["aq_deagle_naga"] = { name = "Naga", desc = "Broń została wygrawerowana i istnieje na niej motyw mitologiczny.\n\nBestia w indyjskiej mitologii, jak również na polu bitwy." },
	["cu_galil_abrasion"] = { name = "Papla", desc = "Broń została ręcznie pomalowana i sztucznie postarzona. Czaszka namalowana na pokrywie komory zamkowej sprawia wrażenie, jakby paplała, gdy zamek się cofa.\n\nLudzie mówią, że gdy śmiejesz się, to śmieje się z tobą cały świat... Ale gdy Papla się śmieje, słychać tylko krzyki." },
	["cu_glock_deathtoll"] = { name = "Katakumby", desc = "Broń została pomalowana warstwą srebrnego, metalicznego podkładu, a następnie pokryta hydrografiką w postaci czaszek.\n\nZastraszanie jest najszczerszą formą pochlebstwa." },
	["cu_m4a4_ancestral"] = { name = "龍王 (Smoczy władca)", desc = "Broń została ozdobiona na zamówienie grafiką smoka w czerwieni i błękicie.\n\nBroń godna samego Małpiego Króla. – Booth, handlarz bronią" },
	["cu_m249_sektor"] = { name = "Blokada systemu", desc = "Broń została ozdobiona na zamówienie wzorem o tematyce sci-fi.\n\nOgień osłaniający jeszcze nigdy nie wyglądał tak dobrze." },
	["am_mac10_malachite"] = { name = "Malachit", desc = "Broń została pomalowana farbami naśladującymi efekt metaliczny, a falowany wzór został uzyskany przy pomocy gumowego grzebienia.\n\nJasne barwy skrywają broń z mrocznym powołaniem." },
	["cu_mp9_deadly_poison"] = { name = "Śmiertelna trucizna", desc = "Broń została ozdobiona na zamówienie dynamicznymi kształtami pod wieloma kątami oraz stylizowanym pająkiem.\n\nTo nie pierwsze ukąszenie cię zabija, tylko kolejne 29." },
	["cu_p250_mandala"] = { name = "Muertos", desc = "Broń została ozdobiona na zamówienie grafiką czaszki w stylizowanych okręgach.\n\nGłęboko zakorzeniona tradycja krwi." },
	["cu_sawedoff_deva"] = { name = "Spokój", desc = "Broń została pokryta ręcznie malowanym wzorem w postaci kobiety ze skrzydłami.\n\nTylko niewielu może zaznać spokoju. – Valeria Jenner, rewolucjonistka" },
	["aq_scar20_leak"] = { name = "Grota", desc = "Broń została pomalowana niebieskimi farbami metalicznymi przy użyciu gąbki i pędzla.\n\nZałożyciel Season Corporation kazał zaprojektować ten wzór po tym, jak został uratowany przez sławnego agenta Kotaro Izakiego." },
	["aq_xm1014_sigla"] = { name = "Rtęć", desc = "Broń została pomalowana warstwą srebrnej farby metalicznej, a następnie pokryta półprzezroczystą hydrografiką w postaci mapy terenu.\n\nCzasami potrzeba niestabilnego pierwiastka do rozwiązania problemu. – Kotaro Izaki, specjalista od torowania wejść" },
	["an_tiger_orange"] = { name = "Tygrysi kieł", desc = "Broń została anodyzowana, a następnie pomalowana farbą pomarańczową, na której ręcznie wygrawerowano wzór tygrysich pasów.\n\nJest tak rzadki jak tygrys... jest też tak zabójczy jak tygrys..." },
	["am_marble_fade"] = { name = "Marmurkowy gradient", desc = "Broń została pomalowana metalicznymi farbami - czarną i srebrną - z użyciem środka do marmurkowania, a następnie pokryta farbą w trzech kolorach, którą utwardzono.\n\nOstrze mieni się wieloma kolorami, ale wkrótce pozostanie na nim sama czerwień." },
	["am_marbleized"] = { name = "Doppler", desc = "Broń została pomalowana czarną i srebrną farbą metaliczną z użyciem środka do marmurkowania, a następnie ją utwardzono.\n\nZagubienie się w tym kolorze może być śmiertelne." },
	["cu_ak47_mastery"] = { name = "Elite Build", desc = "It has been custom painted using a combination of hydrographics and careful stenciling and detailed with heat-transfer decals.\n\nTread softly Naomi...people in your line of work aren't known for their longevity - The Shield and The Serpent Part 2" },
	["aq_mp7_ultramodern"] = { name = "Pancerny rdzeń", desc = "Broń została pomalowana czarną farbą olejną oraz otrzymała inkrustację i części ze szczotkowanej, nierdzewnej stali.\n\nIdealne dla agenta ceniącego finezję tak samo, jak siłę ognia. – Booth, handlarz bronią" },
	["aq_awp_twine"] = { name = "Robaczy bóg", desc = "Broń została pomalowana wytrzymałymi farbami emaliowymi na motyw czaszki i korzeni.\n\nSą takie korzenie, których nie zechcesz chwycić." },
	["am_bronze_sparkle"] = { name = "Brązowe déco", desc = "Broń została pomalowana na wzór art deco z użyciem metalicznych farb motoryzacyjnych.\n\nWszyscy poszukują złota i srebra." },
	["aq_p250_contour"] = { name = "Walencja", desc = "Broń została ozdobiona na zamówienie nowoczesnym, niebiesko-szarym wzorem, który komponuje się z jej kształtem.\n\nNie kwestionuję twoich umiejętności, tylko twoje nastawienie. – Nauczyciel i obrazoburca, część I" },
	["cu_fiveseven_banana"] = { name = "Małpi biznes", desc = "To jest banan.\n\nCzasami można się pobawić jedzeniem." },
	["cu_galil_eco"] = { name = "Eco", desc = "Broń została pomalowana na kolor biało-zielony, a następnie pokryta naklejkami termotransferowymi.\n\nZa odpowiednią sumę pieniędzy Elite Crew weźmie wszystko na siebie." },
	["aq_famas_jinn"] = { name = "Dżin", desc = "Broń została inkrustowana złotem i niklem oraz wygrawerowano na niej obrazek dżina.\n\nUważaj, czego sobie życzysz." },
	["cu_m4a1_hyper_beast"] = { name = "Hyper Beast", desc = "It has been custom painted with a beastly creature in psychadelic colours.\n\nYou really want to impress me Booth? Make this black light sensitive - Rona Sabri, Rising Star" },
