	["cu_mac10_neonrider"] = { name = "Neonowy jeździec", desc = "Broń została ozdobiona na zamówienie motywem przedstawiającym zabójczego motocyklistę.\n\nW jednej trzeciej broń palna, a w dwóch trzecich guma Turbo." },
	["cu_sawedoff_origami"] = { name = "Origami", desc = "Broń została ozdobiona na zamówienie motywem zainspirowanym origami.\n\nPotrzeba czasu na zbudowanie czegoś pięknego, ale tylko chwili na jego zniszczenie." },
	["cu_cz75_precision"] = { name = "Pole position", desc = "Broń została ozdobiona na zamówienie czerwono-szarym motywem wyścigowym.\n\nMamy na to tylko jedną szansę, zróbmy to jak należy. – Felix Riley, oficer dowodzący" },
	["am_ump_racer"] = { name = "Grand Prix", desc = "Broń została ozdobiona na zamówienie staromodnym motywem wyścigowym.\n\nNie zapomnij o kasku." },
