	["cu_chronos_g3sg1"] = { name = "Chronos", desc = "Broń została pokryta hydrografiką w postaci mechanizmu zegarka w psychodelicznych kolorach, a następnie naklejkami termotransferowymi.\n\nW swoim czasie wszystko jest możliwe." },
	["hy_hades"] = { name = "Hades", desc = "Broń została pokryta hydrografiką w postaci starożytnych greckich hełmów.\n\nJeśli chciała przeprowadzić ze mną wywiad, zapewne mogła go zaaranżować w nieco łatwiejszy sposób. – Tarcza i baśniopisarz, część II" },
	["hy_icarus"] = { name = "Upadek Ikara", desc = "Broń została pokryta hydrografiką w postaci piór i stopionego wosku dookoła stylizowanego słońca.\n\nZdrada Turnera to moja porażka... muszę to naprostować. – Sebastien Hennequet, snajper" },
	["cu_labyrinth"] = { name = "Labirynt Minotaura", desc = "Broń została pokryta hydrografiką w postaci izometrycznego labiryntu.\n\nOde mnie nie ma ucieczki." },
	["sp_labyrinth1"] = { name = "Asterion", desc = "Broń została pomalowana farbą w sprayu, używając szablonu o wzorze izometrycznego labiryntu.\n\nKrólowie to tylko ludzie... a żadnego człowieka nie powinno się czcić. – Valeria Jenner, rewolucjonistka" },
	["sp_labyrinth2"] = { name = "Pionier", desc = "Broń została pomalowana farbą w sprayu, używając szablonu o wzorze izometrycznego labiryntu.\n\nOsobiście wolę czwartą edycję, ale klient ma zawsze rację. – Booth, handlarz bronią" },
	["sp_labyrinth3"] = { name = "Dedal", desc = "Broń została pomalowana farbą w sprayu, używając szablonu o wzorze izometrycznego labiryntu.\n\nImogen... jeśli się dowiedzą, co zrobiłaś, za tę pomyłkę zapłacimy wszyscy. – Sprawa rodzinna, część I" },
	["cu_medusa_awp"] = { name = "Meduza", desc = "Broń została ozdobiona na zamówienie grafiką gorgony. \n\nJeśli mnie widzisz, to już nie żyjesz." },
	["gs_mother_of_pearl_elite"] = { name = "Pojedynkowicz", desc = "Broń została pokryta nienaturalną, ciemną patyną, a jej chwyty zostały ozdobione masą perłową.\n\nNie zawiera gumy balonowej." },
	["aa_pandora"] = { name = "Puszka Pandory", desc = "Broń została ozdobiona kreskówkowymi duszkami, które naniesiono aerografem.\n\nŚwiat płonie, ale przynajmniej mamy nadzieję." },
