	["so_khaki_green"] = { name = "Spadochroniarska zieleń", desc = "Poszczególne części tej broni zostały pomalowane farbą w sprayu na kolor khaki oraz czarny. \n\nTo, kim był, nie zmieni tego, kim jest teraz. Nie martw się, Felix... powstrzymam go. – Paladyn i nauczyciel, część II" },
	["cu_anime_aug"] = { name = "Akceptacja Akihabary", desc = "Broń została udekorowana naklejkami termotransferowymi w postaci okładki magazynu anime.\n\nYatta!" },
	["am_bamboo_jungle"] = { name = "Hydroponika", desc = "Broń została pomalowana farbami metalicznymi z motywem bambusa.\n\nZauważ, jak rusznikarka Yukako użyła drewna z AK-47, by zaakcentować jej zielony motyw... nie miej złudzeń: hydroponika jest tak piękna i zabójcza, jak sama natura. – Imogen, początkująca handlarka bronią" },
	["hy_bamboo_jungle_ink"] = { name = "Bambusowy nadruk", desc = "Broń została pokryta hydrografiką w postaci bambusa malowanego pędzlem.\n\nTutaj wstaw grę słowną o strzelaniu." },
	["hy_bamboo_jungle_black"] = { name = "Bambusowy cień", desc = "Broń została pokryta hydrografiką w postaci bambusa malowanego pędzlem.\n\nTa broń zabiła syna Kotaro... i pewnego dnia użyje jej, by zatrzymać poprzedniego strzelca." },
	["hy_bamboo_jungle"] = { name = "Bambusowy las", desc = "Broń została pokryta hydrografiką w postaci bambusa malowanego pędzlem.\n\nNadal sądzę, że powinna mieć pandę. – Booth, handlarz bronią" },
