	["hy_geometric_steps"] = { name = "Geometryczne schodki", desc = "Broń została pokryta hydrografiką w postaci geometrycznego motywu." },
	["hy_geometric_steps_green"] = { name = "Antyschodki", desc = "Broń została pokryta hydrografiką w postaci geometrycznego motywu.\n\nHej Sabri, weź tę... jest tak głośna, jak ty. – Carmen Cocinero, specjalistka od uwalniania zakładników" },
	["hy_geometric_steps_yellow"] = { name = "Schodki", desc = "Broń została pokryta hydrografiką w postaci geometrycznego motywu.\n\nZa bardzo ufasz Valerii... przez to kiedyś zginiesz. – Franz Kriegeld, taktyk Phoenix" },
	["hy_kimono_diamonds"] = { name = "Neonowe kimono", desc = "Broń została pokryta hydrografiką w postaci geometrycznego motywu.\n\nWiem, że proszę cię o wiele... Turner był jak twój syn. – Paladyn i nauczyciel, część I" },
	["hy_kimono_diamonds_orange"] = { name = "Pomarańczowe kimono", desc = "Broń została pokryta hydrografiką w postaci geometrycznego motywu.\n\nTradycja to silna rzecz." },
	["hy_kimono_diamonds_red"] = { name = "Szkarłatne kimono", desc = "Broń została pokryta hydrografiką w postaci geometrycznego motywu.\n\nTurner, wszystkich można złamać... to kwestia znalezienia właściwego punktu nacisku. – Przeniewierca i poszukiwacz prawdy, część II" },
	["sp_kimono_diamonds"] = { name = "Miętowe kimono", desc = "Broń została pomalowana farbą w sprayu w motyw geometryczny.\n\nChodź, Booth, pokażę ci, nad czym pracuję. – Yukako, rusznikarka" },
	["am_seastorm"] = { name = "Sztorm o północy", desc = "Broń została pomalowana warstwą niebieskiego, metalicznego podkładu, a następnie pokryta hydrografiką w postaci sztormu.\n\nNie żebym cię nienawidził, Sebastienie... jest mi cię po prostu żal. – Chase Turner, zbieg Koalicji" },
	["am_seastorm_blood"] = { name = "Sztorm o zachodzie słońca 壱", desc = "Broń została pomalowana warstwą czerwonego, metalicznego podkładu, a następnie pokryta hydrografiką w postaci sztormu.\n\nWydaje ci się, że to to samo, ale spójrz jeszcze raz... subtelność zmienia wszystko." },
	["am_seastorm_shojo"] = { name = "Sztorm o zachodzie słońca 弐", desc = "am_seastorm_shojo" },
