	["cu_ak47_courage_alt"] = { name = "Odwet akwamaryny", desc = "Broń została ozdobiona na zamówienie grafiką stada delfinów.\n\nCzy jest tutaj echo?" },
	["cu_cz75a_chastizer"] = { name = "Osa", desc = "Broń została ozdobiona na zamówienie zakrzywionymi kształtami.\n\nFruwaj jak motyl, żądl jak pełen nienawiści insekt." },
	["am_famas_dots"] = { name = "Sieć neuronowa", desc = "Broń została pomalowana warstwą metalicznego podkładu, a następnie pokryta przejrzystą hydrografiką.\n\nWiem. Ale to była jedyna słuszna rzecz, jaką można było zrobić... – Sprawa rodzinna, część II" },
	["cu_galilar_particles"] = { name = "Rakietowe bum", desc = "Broń została ozdobiona na zamówienie wzorem w paski i pikselowate cząsteczki.\n\nIdealna rzecz na gorący, letni dzień." },
	["aq_glock18_flames_blue"] = { name = "Palnik Bunsena", desc = "Broń została pokryta niebieską patyną, która została częściowo starta na zamku, by uzyskać wzór płomieni.\n\nPUK-PUK." },
	["cu_m4a4_evil_daimyo"] = { name = "Zły daimyō", desc = "Broń została ozdobiona na zamówienie wzorem w czerni i czerwieni.\n\nCarmen. Znalazłem go... – Oni i walkiria, część I" },
