	["cu_negev_annihilator"] = { name = "Chwalipięta", desc = "Broń została ozdobiona na zamówienie potwornym wzorem, a następnie postarzona.\n\nWracaj tu, mówię do ciebie!" },
	["cu_nova_ranger"] = { name = "Ranger", desc = "Broń została pokryta hydrografiką w postaci smugi pędzla, a następnie naklejkami termotransferowymi.\n\nKto liczy punkty?" },
	["aq_p2000_boom"] = { name = "Pistolero", desc = "Broń została ozdobiona na zamówienie grafiką ręki wykonującej gest celowania.\n\nKoniec zabawy." },
	["cu_ump45_uproar"] = { name = "Rozróba", desc = "Broń została pokryta połączeniem hydrografiki i naklejek termotransferowych.\n\nJeśli nie chciałaś zniszczeń ubocznych, trzeba było się określić... – Javier Alviso, Pięść Phoenix" },
	["cu_usp_progressiv"] = { name = "Moment siły", desc = "Broń została ozdobiona na zamówienie nowoczesnym wzorem w czerni, bieli i żółci.\n\nManipulują tobą, Kotaro. A jeśli tego nie dostrzegasz, to jesteś w większych kłopotach, niż myślisz... – Felix Riley, oficer dowodzący" },
	["cu_ak47_winter_sport"] = { name = "Mglisty front", desc = "Broń została pomalowana farbą w jaskrawych kolorach o arktycznych odcieniach.\n\nLubię pracować w śniegu... zawsze pozostaje piękny obraz. – Javier Alviso, Pięść Phoenix" },
	["cu_dualberretta_dragons"] = { name = "Walczące smoki", desc = "Broń została wygrawerowana laserowo wzorem w postaci smoka na zamku i lufie.\n\nMarian zawsze była fajniejsza od Sylvii." },
	["cu_famas_lenta"] = { name = "Ocalały zet", desc = "Broń została pokryta taśmą maskującą, a następnie sztucznie postarzona.\n\nCo jest czerwone, białe i strzela z automatu?" },
	["gs_g3sg1_flux_purple"] = { name = "Przepływ", desc = "Broń została pomalowana fioletowymi i srebrnymi farbami metalicznymi.\n\nPlan to lista rzeczy, które się nie wydarzą." },
	["gs_galil_nightwing"] = { name = "Zimny jak głaz", desc = "Broń została pokryta akcentami pomalowanymi niebieską farbą metaliczną. Kolba i magazynek noszą symbol projektanta.\n\nMusisz kiedyś wyjść z cienia swojego mistrza." },
	["gs_glock18_wrathys"] = { name = "Zjawy", desc = "Zamek tej broni został pokryty wzorem w postaci zagubionej duszy.\n\nNajpierw przeszywa całun, a następnie cień." },
	["gs_m249_nebula_crusader"] = { name = "Kosmiczny krzyżowiec", desc = "Broń została ozdobiona na zamówienie wzorem o wyglądzie klasycznego automatu do gier.\n\nMożna użyć, ale najpierw wrzuć monetę." },
