	["cu_mag7_myrcene"] = { name = "Kobaltowy rdzeń", desc = "Broń została ozdobiona na zamówienie futurystycznym wzorem.\n\nChroń go, Carmen. – Walkiria i luby, część I" },
	["cu_mp7_classified"] = { name = "Dostawa specjalna", desc = "Broń została -OCENZUROWANO-\n\nJeżeli zrobię co chcesz, czy puścisz mnie wolno? – Phoenix i gawędziarz, część II" },
	["hy_p250_crackshot"] = { name = "Skrzydłowy", desc = "Broń została ozdobiona na zamówienie jaskrawą hydrografiką.\n\nCzasami wystarczy delikatne szturchnięcie, by dostać to, czego się chce. – Franz Kriegeld, taktyk Phoenix" },
	["gs_scar20_peacemaker03"] = { name = "Zielony marine", desc = "Broń została pomalowana wzorem w postaci kamuflażu metaliczną farbą.\n\nSłuchajcie, ludziska... Nawet jeśli Izaki i Cocinero zdezerterowali, nasza misja pozostaje taka sama: ratujemy Alexa Kincaide'a. – Felix Riley, oficer dowodzący" },
	["cu_ssg08_technicality"] = { name = "Żelastwo", desc = "Broń została ozdobiona na zamówienie żółtą i pomarańczową hydrografiką, a następnie w niewielkim stopniu sztucznie postarzona.\n\nZwycięstwo z gwiazdką to wciąż zwycięstwo. – Rona Sabri, wschodząca gwiazda" },
	["cu_usp_kill_confirmed"] = { name = "Zabójstwo potwierdzone", desc = "Broń została ozdobiona na zamówienie wzorem kuli przebijającej czaszkę.\n\nDwie kule w tułów, jedna w głowę." },
	["aq_xm1014_scumbria"] = { name = "Makrela", desc = "Broń została subtelnie pomalowana metalicznymi farbami.\n\nNie spieszmy się - może być inny sposób, by zwrócić uwagę Valerii... – Ojcowska miłość, część III" },
	["cu_ak47_point_disarray"] = { name = "Sedno zamieszania", desc = "Broń została pokryta hydrografiką w postaci geometrycznego motywu.\n\nZ bliska jest jak chaos... a z daleka jest ślicznotką. – Franz Kriegeld, taktyk Phoenix" },
	["am_aug_jumble"] = { name = "Rykoszet", desc = "Broń została ozdobiona na zamówienie dwukolorowym wzorem przeplotu.\n\nKotaro nie potrzebuje naszej ochrony. – Walkiria i luby, część II" },
	["cu_bizon_noxious"] = { name = "Pręt paliwowy", desc = "Broń została ozdobiona na zamówienie tak, by amunicja wyglądała na skażoną.\n\nCzasami trepy mają przewagę." },
	["aq_deagle_corinthian"] = { name = "Koryncki", desc = "Broń została wygrawerowana laserowo, a jej uchwyt został oprawiony w skórę.\n\nChronić. Mieć nadzieję. Ufać. Trwać." },
	["cu_fiveseven_retrobution"] = { name = "Retrobucja", desc = "Broń została ozdobiona na zamówienie hydrografiką w stylu retro.\n\nPewne rzeczy nigdy nie przestają być modne." },
	["cu_g3sg1_executioner"] = { name = "Kat", desc = "Broń została pokryta ręcznie malowanym wzorem w postaci makabrycznych kości.\n\nZawsze biorę trofeum. – Javier Alviso, Pięść Phoenix" },
	["gs_m4a4_royal_squire"] = { name = "Królewski paladyn", desc = "Broń została starannie wygrawerowana i pomalowana w celu uzyskania poczucia majestatyczności. \n\nTen telefon nigdy nie miał miejsca, rozumiesz? – Paladyn i ojciec, część I" },
	["cu_negev_impact"] = { name = "Ciężki podnośnik", desc = "Broń została ozdobiona na zamówienie hydrografiką przypominającą ciężki sprzęt budowlany.\n\nPostrach królowych. Ulubieniec biskupów." },
	["am_p2000_imperial_red"] = { name = "Cesarski", desc = "Broń została wygrawerowana laserowo i pomalowana czerwonymi i żółtymi farbami metalicznymi.\n\n Keo, moje uczucia nie mają znaczenia, muszę chronić imperium. – Booth, handlarz bronią" },
	["cu_p90_shapewood"] = { name = "Obrobione drewno", desc = "Drewniana kolba została ręcznie wyrzeźbiona, wyszlifowana i zalaminowana.\n\nCążki sprzedawane oddzielnie." },
	["gs_sawedoff_necromancer"] = { name = "Yorick", desc = "Broń została pokryta hydrografiką w postaci czaszki i ręcznie pomalowana złotymi akcentami.\n\nRosencrantz i Guildenstern nie mieli nawet cienia szansy..." },
	["hy_scar20_jungler"] = { name = "Epidemia", desc = "Broń została pomalowana w jaskrawych odcieniach zieleni.\n\nOstatnio Valeria staje się coraz bardziej bezczelna… czas dać jej popalić – Felix Riley, oficer dowodzący" },
	["gs_sg553_tiger_moth"] = { name = "Ćma tygrysia", desc = "Broń została ozdobiona na zamówienie wzorem skrzydeł ćmy.\n\nValeria działa coraz śmielej... czas sprowadzić walkę na jej terytorium. – Felix Riley, oficer dowodzący" },
	["cu_tec9_avalanche"] = { name = "Lawina", desc = "Broń została pomalowana na zamówienie smukłą i futurystyczną hydrografiką.\n\nMusimy dobrze obmyślić, jakie kroki wobec niej poczynić - jeden zły ruch i zwali się na nas obydwóch. – Wąż i poszukiwacz prawdy" },
	["aq_xm1014_hot_rod"] = { name = "Palnik Teclu", desc = "Broń została pokryta farbą metaliczną, aby dodać motyw płomieni.\n\nCzasami Bunsen nie wystarcza..." },
	["gs_ak47_supercharged"] = { name = "Wtrysk paliwa", desc = "Korpus karabinu został pomalowany na kolor jasnożółty, a wygląd magazynka został zmieniony tak, by wyglądał jak mechanizm maszyny.\n\nOd nowego życia dzieli cię ćwierć magazynka." },
	["cu_bizon_citizen"] = { name = "Strefa eufotyczna", desc = "Broń została pokryta niestandardowym kamuflażem, a jej elementy zostały pomalowane farbą fluorescencyjną.\n\nTo nie dźwięk rozbijających się o morze fal..." },
	["aq_deserteagle_kumichodragon"] = { name = "Smok kumicho", desc = "Na chwycie i zamku zostały wygrawerowane laserowo smoki.\n\nJestem wielkim miłośnikiem twojej pracy, Yukako. Powinniśmy porozmawiać... – Huxley, konkurent" },
	["cu_fiveseven_augmented"] = { name = "Triumwirat", desc = "Broń została pokryta hydrografiką w postaci jasnoniebieskiego kamuflażu DDPAT, a jej zamek został ozdobiony na zamówienie.\n\nNie czerpię zysków z wojny, lecz z uwarunkowania ludzkich zachowań... – Booth, handlarz bronią" },
	["gs_glock18_award"] = { name = "Królewski legion", desc = "Broń została starannie wygrawerowana.\n\nNaomi rozumie, że pewnego dnia zginie za Valerię." },
	["gs_m4a4_pioneer"] = { name = "Waleczna gwiazda", desc = "Z paragonu odcięto wszystkie rogi.\n\nStrzeż się mówiących o strażnicy." },
	["am_mac10_electricity"] = { name = "Niebieski aligator", desc = "Broń została pokryta elektrografiką w postaci jaskrawej skóry aligatora.\n\nŁódź nie jest częścią zestawu." },
	["gs_mag7_praetorian"] = { name = "Pretorianin", desc = "Broń została pomalowana farbami metalicznymi.\n\nIglica się ukształtowuje." },
	["sp_mp7_impire"] = { name = "Chochlik", desc = "Broń została pokryta hydrografiką w postaci hordy chochlików.\n\nDziesiątkowanie nigdy nie było takie rozkoszne." },
	["cu_ssg08_necropos"] = { name = "Nekropos", desc = "Broń została pokryta ręcznie malowanym wzorem w postaci nikczemnych run.\n\nKażdy stolarz potrzebuje młotka, każdy krawiec wrzeciona..." },
	["gs_tec9_jambiya"] = { name = "Dżambia", desc = "Broń została pokryta ręcznie malowanym wzorem, a następnie został na niej wygrawerowany bliskowschodni wzór.\n\nSzeherezada opowiedziała tysiąc baśni... ta będzie ostatnia, jaką usłyszysz." },
	["gs_usp_voltage"] = { name = "Izolator", desc = "Broń otrzymała wygrawerowany na zamówienie zamek i tłumik.\n\nMasz, czego chciałeś. Czy teraz rozumiesz, co to znaczy? – Booth, handlarz bronią" },
	["cu_aug_swallows"] = { name = "Klucz ptaków", desc = "Broń została pokryta hydrografiką w postaci ptaków szybujących w przestworzach.\n\nNiektóre z ptaków reprezentują pokój i harmonię... ale to nie ten gatunek." },
	["cu_bizon_Curse"] = { name = "Osąd Anubisa", desc = "Broń została ozdobiona na zamówienie motywem egipskim.\n\nJej spust jest lżejszy niż piórko." },
	["gs_cz75a_redastor"] = { name = "Czerwony astor", desc = "Broń została pokryta ręcznie malowanym wzorem w postaci czerwonych i białych akcentów.\n\nBooth stał się synonimem rodzinnego dramatu - a kto ma czas na dramaty, kiedy rozmawiamy o interesach? – Huxley, konkurent" },
	["gs_dualberettas_ventilators"] = { name = "Wywietrzniki", desc = "Te pistolety zostały pokryte ozdobnym chromem.\n\nBroń od artystów, dla artystów." },
	["sp_g3sg1_militiaorange"] = { name = "Pomarańczowa kraksa", desc = "Szablony i pomarańczowa farba w sprayu nadały temu karabinowi jego charakterystyczny wygląd.\n\nStań się współczesnym Shere-chanem." },
	["gs_galilar_incenerator"] = { name = "Strzelanina", desc = "Broń została przyozdobiona szkarłatnymi akcentami i ręcznie malowanym symbolem.\n\nBooth zlecił wykonanie tej broni dla Valerii, aby załagodzić spór z Phoenix." },
	["cu_m249_spectre"] = { name = "Widmo", desc = "Broń została pomalowana z zastosowaniem smukłego, współczesnego wzornictwa.\n\nWewnętrzny konflikt w strukturach Phoenix rozpocznie się lada moment." },
	["cu_m4a1s_soultaker"] = { name = "Płomień Chantico", desc = "Broń została ręcznie pomalowana barwnymi kolorami, podkreślonymi przez uśmiechniętą twarz na kolbie.\n\nChroń, co należy do ciebie." },
	["am_mp9_bioleak"] = { name = "Wyciek biologiczny", desc = "Różne odcienie zieleni tworzą iluzję chemicznego wycieku.\n\nUNIKAJ BEZPOŚREDNIEGO KONTAKTU." },
	["hy_p2000_oceani"] = { name = "Oceaniczny", desc = "Broń została pomalowana warstwą czarnego podkładu, a następnie ozdobiona niebieskimi wzorami.\n\nCzy ktokolwiek słyszał jakieś wieści od Kotaro lub Carmen? - Felix Riley, oficer dowodzący" },
	["cu_p250_asiimov"] = { name = "Asiimov", desc = "Broń została ozdobiona na zamówienie wzorem o tematyce sci-fi.\n\nJeżeli myślisz, że potrzebuję karabinu, aby zabić człowieka, to nie masz zielonego pojęcia, z kim właśnie rozmawiasz... – Mikha Biton, snajper Phoenix" },
	["gs_sawedoff_fubar"] = { name = "Fubar", desc = "Na lufie tej wysłużonej strzelby wyryto liczbę ofiar.\n\nZaczyna się od huku... kończy się ciszą." },
	["cu_sg553_atlas"] = { name = "Atlas", desc = "Broń została pokryta nowoczesną hydrografiką o wzorze kamuflującym.\n\nTen projekt był niegdyś przeznaczony dla Sił Specjalnych Koalicji, ale Huxley wkręcił się w szpiegostwo przemysłowe, aby zdobyć ją dla Phoenix na wyłączność." },
	["gs_ssg08_armacore"] = { name = "Eteryczny krzyżowiec", desc = "Broń została pomalowana na biało i ozdobiona arktycznymi niebieskimi akcentami.\n\nNigdy nie będę mógł zastąpić tego, co zostało nam odebrane... ale jestem w stanie odebrać im jeszcze więcej. – Phoenix i nowicjusz, część II" },
	["am_tec9_redblast"] = { name = "Zapłon", desc = "Lufa została pokryta naklejką w postaci płomienia.\n\nNienawidzę ciągle mieć rację. – Carmen Cocinero, specjalistka od uwalniania zakładników" },
	["cu_ump45_primalsaber"] = { name = "Szablozębny", desc = "Broń posiada naklejkę z wizerunkiem czaszki tygrysa szablozębnego.\n\nKażdy drapieżnik w końcu ginie." },
	["cu_xm1014_spectrum"] = { name = "Strój galowy", desc = "Połączenie białej i czarnej farby chromowej sprawia, że strzelba ta najlepiej nadaje się na uroczyste okazje.\n\nDorwaliśmy Izakiego i Cocinero. Potrzebujecie ich do czegoś, czy możemy ich już zabić? – Najemnik i wąż, część I" },
	["am_marbleized_g"] = { name = "Gamma Doppler", desc = "Broń została pomalowana czarną i srebrną farbą metaliczną z użyciem środka do marmurkowania, a następnie ją utwardzono." },
	["gs_autotronic"] = { name = "Autotronika", desc = "Broń została anodyzowana, a następnie pomalowana czerwoną farbą. Korzysta ona także ze stalowej siatki w celu zmniejszenia wagi." },
	["am_marked_up"] = { name = "Rękodzieło", desc = "Broń została pomalowana czarną i fioletową farbą, a następnie udekorowana metalicznym markerem." },
	["gs_aug_aristocrat"] = { name = "Arystokrata", desc = "Broń została pomalowana anodyzowanym, jasnoniebieskim podkładem, a następnie ozdobiona za pomocą srebrnej, filigranowej aplikacji.\n\nDla tego jednego procenta." },
	["gs_awp_phobos"] = { name = "Fobos", desc = "Broń została skonstruowana z metalowych paneli i wytrzymałych podzespołów elektronicznych.\n\nZbuduj lepszy świat." },
	["cu_five_seven_daimyo"] = { name = "Brutalny daimyō", desc = "Broń została ozdobiona na zamówienie wzorem w czerni i fiolecie.\n\nJak będziesz rządzić?" },
	["cu_glock_wasteland_rebel"] = { name = "Pustynny buntownik", desc = "Broń została sztucznie postarzona, pokryta stemplowanymi wzorami oraz graffiti.\n\nOddaj hołd." },
	["gs_m4a1_mecha_industries"] = { name = "Mecha Industries", desc = "Broń została skonstruowana z utwardzanych paneli ceramicznych.\n\nPrzedstawiamy najnowocześniejszą technologię." },
