	["aq_mac_10_alien_camo"] = { name = "Mięsożerca", desc = "Broń została pomalowana warstwą metalicznego podkładu, a następnie pokryta hydrografiką w kolorze czerwonym i fioletowym.\n\nPrzygotuj przed podaniem." },
	["aq_nova_sci_fi"] = { name = "Exo", desc = "Broń została pomalowana warstwą fioletowego podkładu ze wzorem, a następnie pokryta hydrografiką w postaci srebrnych wielokątów.\n\nLiczy się wnętrze." },
	["gs_p2000_imperial_dragon"] = { name = "Smok cesarski", desc = "Broń została ozdobiona na zamówienie grafiką z motywem smoka przy użyciu czerwonych farb metalicznych.\n\nSpójrz na zachód." },
	["gs_p250_metal_panels"] = { name = "Żelazne okucie", desc = "Broń została udekorowana przynitowanymi metalowymi panelami.\n\nNiezawodność i bezpieczeństwo gwarantowane." },
