	["gs_pp_bizon_harvester"] = { name = "Żniwiarz", desc = "Broń została udekorowana biomechanicznym motywem.\n\nPomyślnie wykonany eksperyment biomechaniczny." },
	["cu_r8_cybersport"] = { name = "Restart", desc = "Broń została pokryta srebrnymi i czarnymi panelami, a następnie ozdobiona czerwonymi akcentami.\n\n„A próbowałeś wyłączyć i włączyć?”" },
	["cu_sawed_off_lime"] = { name = "Limetka", desc = "Broń została ozdobiona na zamówienie wzorem w postaci limonkowych i białych zamaszystych krzywych.\n\nWszystkie oczy na tobie." },
	["gs_scar20_bloodsport"] = { name = "Krwawy sport", desc = "Broń została pokryta czerwono-czarną hydrografiką, a następnie białymi naklejkami.\n\nAntyterroryści są sponsorowani przez…" },
	["cu_sg553_aerial"] = { name = "Awiator", desc = "Broń została pomalowana srebrną i żółtą farbą, a następnie pokryta naklejkami przedstawiającymi białe skrzydła.\n\nOsiągnij przewagę w powietrzu." },
	["am_tec_9_sea_salt"] = { name = "Czapa lodowa", desc = "Broń została pokryta niebiesko-białą abstrakcyjną hydrografiką.\n\nZatop przeciwników." },
	["bloodhound_black_silver"] = { name = "Osmalone", desc = "Ta para została wykonana z klasycznej miękkiej skóry.\n\nŻetony wyzwań są niezłe, ale nie sprawiają, że leci krew, gdy kogoś uderzasz - Carmen Cocinero, specjalistka od uwalniania zakładników" },
	["bloodhound_snakeskin_brass"] = { name = "Ukąszenie węża", desc = "Ta para została wykonana ze zwykłej skóry oraz skóry węża.\n\nBądźmy szczerzy, nikt nie tęskni za Siergiejem - Hans Kriegeld, taktyk Phoenix" },
	["bloodhound_metallic"] = { name = "Brązowe", desc = "Skóra została zabarwiona na kolor szary oraz brązowy.\n\nOperacja Bloodhound nakreśliła koniec Chase'a Turnera, snajpera-dezertera" },
	["bloodhound_guerrilla"] = { name = "Partyzantka", desc = "Ta para została wykonana z brązowej skóry oraz skóry syntetycznej z nadrukiem w postaci kamuflażu.\n\nValeria planuje zemstę, co do tego nie ma żadnych wątpliwości... - Sebastien Hennequet, snajper" },
	["handwrap_leathery"] = { name = "Skóra", desc = "Składają się one ze skóry, gazy oraz niegodziwych czynów.\n\nStań się przestępcą" },
	["handwrap_camo_grey"] = { name = "Świerkowy DDPAT", desc = "Zewnętrzny bandaż posiada nadruk w postaci zielonego kamuflażu cyfrowego.\n\nNiektórzy mówią, że są silni... inni to okazują" },
	["handwrap_red_slaughter"] = { name = "Rzeź", desc = "Zostały one zabarwione na kolor szkarłatny - ciężko przez to dostrzec, gdzie kończy się materiał, a gdzie zaczynają ślady po krwi.\n\nKtóż nie kocha pracować rękami?" },
	["handwrap_fabric_orange_camo"] = { name = "Badlandy", desc = "Wykonano je naprędce ze znalezionych resztek materiałów.\n\nFelix przymyka oko na nielegalną ligę bokserską Sił Specjalnych Koalicji" },
	["slick_black"] = { name = "Splot księżycowy", desc = "Ta para została wykonana z niebieskiego zamszu oraz czarnej skóry. Na zewnętrznej stronie materiały zostały splecione, co nadaje im ponadczasowy wygląd.\n\nNie pobrudź sobie rąk krwią... metaforycznie oczywiście" },
	["slick_military"] = { name = "Konwój", desc = "Ta para została wykonana z miękkiej brązowej skóry oraz zabarwionego zamszu.\n\nCzasami dyskrecja jest wymagana" },
	["slick_red"] = { name = "Szkarłatny splot", desc = "Ta para została wykonana z czarnego zamszu oraz szkarłatnej skóry. Na zewnętrznej stronie materiały zostały splecione, co nadaje im ponadczasowy wygląd.\n\nZostaw swój ślad, a nie odciski palców" },
	["slick_snakeskin_yellow"] = { name = "Grzechotnik", desc = "Ta para została wykonana ze skóry beżowej i czarnej oraz skóry węża.\n\nModel seryjny jest dla frajerów... - Imogen, początkująca handlarka bronią" },
	["sporty_green"] = { name = "Labirynt ogrodowy", desc = "Ta biało-czarna para została wykonana przez firmę Icarus Athletics.\n\nTylko tchórze boją się latać blisko słońca." },
	["sporty_purple"] = { name = "Puszka Pandory", desc = "Ta czarno-biała para posiada nadruk w postaci subtelnego wzoru, który znajduje się na powierzchni dłoniowej.\n\nMus dla eksperta od materiałów wybuchowych o nadmiernej potliwości dłoni." },
	["sporty_light_blue"] = { name = "Nadprzewodnik", desc = "Ta czarno-niebieska para jest idealna dla osoby, która chce zabłysnąć.\n\nNie mieli żadnego problemu." },
	["sporty_military"] = { name = "Pustynne", desc = "Wiele odcieni brązu oraz subtelny nadruk w postaci kamuflażu nadaje im dystyngowany wygląd.\n\nJeżeli mamy robić za bohaterów, to możemy chociaż wyglądać jak oni... – Rona Sabri, wschodząca gwiazda" },
	["specialist_ddpat_green_camo"] = { name = "Leśny DDPAT", desc = "Ręcznie obszywana skóra została połączona z wytrzymałą tkaniną z nadrukowanym wzorem DDPAT.\n\nNiektórzy nie lubią sobie brudzić rąk." },
	["specialist_kimono_diamonds_red"] = { name = "Szkarłatne kimono", desc = "Na tej parze widnieje delikatny wzór przedstawiający kontrastowe czerwone diamenty.\n\nJak płachta na byka." },
