	["aq_Five_Seven_Scumbria"] = { name = "Makrela", desc = "Broń została pomalowana w ledwo widoczne paski.\n\nNie możesz pozwolić mu umrzeć, Felix; musisz go uratować. – Córka i paladyn, część I" },
	["gs_G3SG1_Ventilator"] = { name = "Wywietrznik", desc = "Broń została pokryta eleganckim czarnym i chromowym malunkiem oraz niestandardowym ogumieniem.\n\nNie martw się Naomi, sprawię, że Felix zapłaci. – Mikha Biton, snajper Phoenix" },
	["cu_Glock18_Weasel"] = { name = "Łasica", desc = "Broń została pokryta hydrografiką z wizerunkiem psotnej łasicy o imieniu Bobby. Nie zadzieraj z Bobbym.\n\nSam fakt bycia słodkim nie oznacza jeszcze, że nie gryzie." },
	["cu_MAG7_Tribal"] = { name = "Petroglif", desc = "Broń została pomalowana na zamówienie we wzór przypominający wyryte w skale rysunki.\n\nKonflikty istniały od momentu, w którym pierwsi jaskiniowcy nauczyli się podnosić kamienie. – Booth, handlarz bronią" },
