	["gs_deagle_fennec"] = { name = "Fenek pustynny", desc = "Lufa tej broni została ozdobiona na zamówienie wzorem przedstawiającym fenka, a chwyt posiada turkusowe i pomarańczowe dodatki.\n\nZ takimi uszami ciężko mi cię nie usłyszeć." },
