	["gs_galil_phoenix"] = { name = "Connexion", desc = "Broń została pomalowana białym i czerwonym podkładem, a następnie farbą w sprayu naniesiono na nią logo organizacji terrorystycznej Phoenix.\n\nBiorą ze sobą ciężki sprzęt." },
	["gs_bizon_hellraider"] = { name = "Runiczny", desc = "Wykonany na zamówienie wzór zdobiący tę broń cechują runy nieznanego pochodzenia oraz magazynek przypominający kartaczownicę Gatlinga.\n\nNiech ich piekło pochłonie." },
	["gs_mp5sd_wasteland_legacy"] = { name = "Składak", desc = "20 lat projektowania MP5 odcisnęło swój ślad na tym wykonanym na zamówienie wzorem zdobiącym tę broń, który trzyma się na taśmach samoprzylepnych, trytytkach i kleju.\n\nJeśli nie wyjdzie ci za pierwszym (i drugim i trzecim) razem..." },
