	["gs_xm1014_watchdog"] = { name = "Czuwający", desc = "Broń została pomalowana jadeitowym zielonym podkładem, a następnie ozdobiona na zamówienie dwoma lwami-stróżami patrzącymi się w dwóch kierunkach. Pod szczerbinką został namalowany trzeci lew.\n\nChroń i rozwijaj się." },
