	["gs_famas_rapid_eyes"] = { name = "Szybkie rozeznanie", desc = "Broń została ozdobiona na zamówienie przeplatającymi się różowymi kwadratami. Widniejące na nich oczy wyglądają jak żywe.\n\nRozszalałe są oczy śniącego." },
	["cu_fiveseven_alpha_omega"] = { name = "Bazgroły", desc = "Broń została pomalowana żółto-morskim podkładem, a następnie pokryta ręcznie malowanymi wzorami z użyciem szerokich kresek.\n\nPierwszy i ostatni." },
