	["cu_mac10_pixie"] = { name = "Uwięzione", desc = "Broń została pokryta na zamówienie wzorem przedstawiającym uwięzione w broni wróżki, które pragną się wydostać.\n\nJeszcze nie znalazły osoby, której nie mogłyby oszukać." },
