	["cu_p250_rebuilt"] = { name = "Prze.budowa", desc = "To P250 zostało ozdobione na zamówienie przeplatającymi się trójkątami i innymi przejrzystymi, minimalistycznymi wzorami.\n\nDo 9 razy sztuka." },
