	["so_sand_bravo"] = { name = "so_sand_bravo", desc = "Poszczególne elementy tej pamiątki z Gwalior zostały pomalowane farbą w sprayu w kolorach imitujących wydmę piaskową.\n\nReporter gonzo Alex Kincaide zaginął gdzieś na terytorium państw Maghrebu, gdzie udał się, by dokumentować przebieg operacji Vanguard." },
	["so_olive_bravo"] = { name = "so_olive_bravo", desc = "Poszczególne elementy tej pamiątki z Cache zostały pomalowane farbą w sprayu na kolor oliwkowy.\n\nNigdy nie bądź pewien zwycięstwa." },
	["an_gunmetal_bravo"] = { name = "an_gunmetal_bravo", desc = "Ta pamiątka z Siege została pokryta warstwą chromowego podkładu, a następnie metaliczną ciemnoszarą farbą dającą efekt anodyzowania.\n\nNie znasz Felixa Rileya tak jak ja... tego faceta nie da się złamać. – Przeniewierca i poszukiwacz prawdy, część I" },
	["am_ossify_blue_p2000_bravo"] = { name = "am_ossify_blue_p2000_bravo", desc = "Ta pamiątka z Seaside została pomalowana warstwą metalicznego podkładu, a następnie pokryta abstrakcyjną, przezroczystą hydrografiką.\n\nFale się łamią, my nie. – Kotaro Izaki, specjalista od torowania wejść" },
	["am_crumple_bravo"] = { name = "am_crumple_bravo", desc = "Ta pamiątka z Agency została pomalowana warstwą chromowego podkładu, a następnie metalicznymi farbami o różnej przepuszczalności światła namalowano wzór przypominający wielokąty.\n\nRzucić ołówki i ręce do góry." },
	["aq_steel"] = { name = "aq_steel", desc = "Działa idealnie pomimo rdzy pokrywającej zewnętrzne elementy.\n\nNiektórzy nie muszą ukrywać, że nie stronią od brudnej roboty." },
	["hy_hex"] = { name = "hy_hex", desc = "Broń została pokryta hydrografiką w postaci sześcioboku." },
	["hy_camo_large"] = { name = "hy_camo_large", desc = "Broń została pokryta hydrografiką w postaci powiększonego kamuflażu." },
	["am_ddpatdense"] = { name = "am_ddpatdense", desc = "Broń została pokryta metaliczną folią z wytłoczonym cyfrowym wzorem." },
	["twigs"] = { name = "twigs", desc = "Broń została ręcznie pomalowana farbą w sprayu, używając gałązek jako szablonu." },
	["varicamo"] = { name = "varicamo", desc = "Broń została pokryta hydrografiką o wzorze VariCamo.\n\nPrzebudowa następuje tylko w obliczu destrukcji." },
	["aq_damascus_knife"] = { name = "aq_damascus_knife", desc = "Broń została wykuta ze sztabki składającej się z dwóch różnych typów stali węglowej.\n\nNareszcie, broń tak silna jak twoja wola walki." },
	["am_crystallized"] = { name = "am_crystallized", desc = "Broń została pomalowana farbą metaliczną z wykorzystaniem maski krystalizującej do stworzenia wzoru.\n\nKażdy chce wywrzeć wpływ." },
	["snakeskin"] = { name = "snakeskin", desc = "Broń została pokryta hydrografiką w postaci skóry węża.\n\nWiem, że nie wierzysz w tę sprawę, a gdy to rozgłoszę, Valeria pośle po twoją głowę - Tarcza i Żmija, część I" },
	["cu_usp-s_elegant"] = { name = "cu_usp-s_elegant", desc = "Broń została pomalowana farbą kobaltową niebieską z oznaczeniem AT na zamku.\n\nMogę przestrzegać przepisów i wydostać siedmioro albo zrobić to po swojemu i uratować całą dziesiątkę... pański wybór. – Carmen Cocinero, specjalistka od uwalniania zakładników" },
	["hy_plaid2"] = { name = "hy_plaid2", desc = "Broń została pokryta hydrografiką w postaci kraty w kolorze ciemnoszarym i niebiesko-zielonym.\n\nTo nie dudy, ale zagra muzykę przed każdym pogrzebem." },
	["cu_fiveseven_urban_hazard"] = { name = "cu_fiveseven_urban_hazard", desc = "Broń została ozdobiona na zamówienie miejskim kamuflażem z czerwonymi motywami.\n\nCo roku Booth zbiera wiodących rusznikarzy, aby mogli pochwalić się swoimi najnowszymi dziełami." },
	["an_emerald"] = { name = "an_emerald", desc = "Broń została pokryta warstwą chromowego podkładu, a następnie przejrzystą farbą naśladującą efekt anodyzowania w kolorze szmaragdowym.\n\nWięc taki los spotkał wielkiego Sebastiena Hennequeta? Został zgrzybiałym belfrem? Co się z tobą stało... – Nauczyciel i obrazoburca, część II" },
	["so_keycolors"] = { name = "so_keycolors", desc = "Poszczególne części tej broni zostały pomalowane farbą w sprayu na kolor niebieski i pomarańczowy.\n\nNie ma litości." },
	["cu_awp_mastery"] = { name = "cu_awp_mastery", desc = "Broń została ozdobiona na zamówienie połączeniem hydrografiki, szablonu i naklejek termotransferowych.\n\nChase Turner wielkim człowiekiem był... masz ogromną pustkę do wypełnienia. – Phoenix i nowicjusz, część I" },
	["aq_dualberettas_cartel"] = { name = "aq_dualberettas_cartel", desc = "Broń została wygrawerowana rysunkami szkieletów, kwiatów i węży.\n\nDlatego Huxley odwala całą robotę. My musimy tylko popchnąć ją do przodu... – Wąż i poszukiwacz prawdy, część II" },
	["aq_famas_contour"] = { name = "aq_famas_contour", desc = "Broń została ozdobiona na zamówienie współczesnym czerwono-szarym wzorem, który podkreśla wygląd broni.\n\nRazem jesteśmy zawsze silniejsi." },
	["cu_nova_hyperbeast"] = { name = "cu_nova_hyperbeast", desc = "Broń została ozdobiona na zamówienie wzorem bestii w psychodelicznych kolorach.\n\nMówią na ciebie Oni, prawda? Takie straszne imię dla takiego smutnego człowieka... – Elliott Kingsman, najemnik" },
	["hy_ocean_knife"] = { name = "hy_ocean_knife", desc = "Broń została pokryta hydrografiką w postaci niebieskiego kamuflażu." },
	["cu_m4a1s_printstream"] = { name = "cu_m4a1s_printstream", desc = "Broń została ozdobiona na zamówienie wyraźnym biało-czarnym wzorem oraz wykończona perłowymi akcentami.\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1;" },
	["cu_usp_printstream"] = { name = "cu_usp_printstream", desc = "Broń została ozdobiona na zamówienie wyraźnym biało-czarnym wzorem oraz wykończona perłowymi akcentami.\n\nWHITE_1; BLACK_1; PEARLESCENT_1; SILENCED_1; PISTOL_1;" },
